import React from 'react';
import { Link } from 'react-router-dom';

const Footer = () => {
    return (
        <footer
            style={{
                background: 'linear-gradient(to right, rgba(0, 0, 0, 0.8), rgba(0, 0, 0, 0.6))',
                color: 'white', // Changed to 'white' for better visibility
                //padding: '0px', // Reduced padding for lower height
                textAlign: 'center',
                position: 'fixed',
                bottom: 0,
                width: '100%',
            }}
        >
            <div>
                <p>&copy; {new Date().getFullYear()} Your Company Name. All rights reserved.</p>
                <p>
                    <Link to="/privacy" style={{ color: 'lightblue', marginRight: '10px' }}>
                        Privacy Policy
                    </Link>
                    <Link to="/terms" style={{ color: 'lightblue' }}>
                        Terms of Service
                    </Link>
                </p>
            </div>
        </footer>
    );
};

export default Footer;
